import React from 'react';
import Button from './navitem';
import { FaKey, FaEye, FaUser } from 'react-icons/fa'; // Exemple d'icônes

const NavbarLeft = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', position: 'absolute', left: '48px', top: '48px', gap:'10px'}}>
      <navicon icon={<FaKey />} label="Truth & Dare" />
      <Button icon={<FaEye />} label="Positions" />
      <Button icon={<FaUser />} label="Rôle" />
    </div>
  );
};

export default NavbarLeft;
